      "content": "//SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/utils/Counters.sol";
import "erc721a/contracts/ERC721A.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "hardhat/console.sol";
import "./Implem/EIP2981PerToken.sol"; 
import "@openzeppelin/contracts/utils/Strings.sol";

contract RwardGenericCollection is ERC721A, EIP2981PerTokenRoyalties, Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _totalCount;
    uint256 private supply;
    bool public isMintEnabled;
    string private tokenBaseUri;
    string private collectionID;
    uint256 private limitPerWallet;

    //events
    event MintEvent(uint256 indexed tokenID, string collID, string message);
    event BurnEvent(uint256 indexed tokenID, string message);
    event MintToggleEvent(bool isEnabled);

    constructor(string memory _name, string memory _symbol, string memory _baseUri, uint256 _supply, uint256 _limitPerWallet, string memory _collectionID) ERC721A(_name, _symbol) {
        supply = _supply;
        tokenBaseUri = _baseUri;
        limitPerWallet = _limitPerWallet;
        collectionID = _collectionID;
    }

    /// @inheritdoc	ERC165
    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(ERC721A, IERC2981)
        returns (bool)
    {
        if(interfaceId == type(IERC721).interfaceId) {
            return true;
        }
        return super.supportsInterface(interfaceId);
    }
    
    function _disableMinting() private {
        isMintEnabled = false;
        emit MintToggleEvent(false);
    }

    function disableMinting() external onlyOwner {
        require(isMintEnabled, 'Minting is currently disabled');

        _disableMinting();
    }

    function _getTotalMint() private view returns (uint256) {
        return _totalCount.current();
    }

    function _enableMinting() private {
        require(!isMintEnabled, 'Minting is currently enabled');
        isMintEnabled = true;
        emit MintToggleEvent(true);
    } 
    
    function enableMinting() public onlyOwner {
        _enableMinting();
    }

    function getTotalSupply() external view returns (uint256) {
        return supply;
    }

    function remainingSupply() external view returns (uint256) {
        return supply - _getTotalMint();
    }
    
    function mintToken(address nftOwner) external payable onlyOwner returns (uint256) {
        uint256 newItemId = _totalCount.current();
        require(isMintEnabled, "Minting is not open.");
        require(!(supply >= 1) || newItemId  < supply, "NFT supply ran out");
        require(!(limitPerWallet >= 1) || balanceOf(nftOwner) < limitPerWallet, "Limit per wallet reached");
        require(!(limitPerWallet >= 1) || _numberMinted(nftOwner) < limitPerWallet, "Address has reached mint limit");
        
        _totalCount.increment();
        
        _safeMint(nftOwner, 1);
        _setTokenRoyalty(newItemId, owner());
        emit MintEvent(newItemId, collectionID, "An NFT was minted successfully");
        return newItemId;  
    }

    function burnToken(uint256 tokenId) public {
        require(ownerOf(tokenId) == msg.sender,  "You are not the owner of this token");
        _burn(tokenId, true);
        emit BurnEvent(tokenId, "An NFT was burned");
    }

    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_exists(tokenId), 'Token not yet existing');        
        return string(abi.encodePacked(tokenBaseUri, _toString(tokenId)));
    }
}"
